/** @jsxImportSource @emotion/react */
import styled from "@emotion/styled";
import { Link } from "react-router-dom";

const Button = styled.button`
  padding: 32px;
  background-color: purple;
  font-size: 24px;
  font-weight: bold;
  &:hover {
    color: white;
  }
`;

function Nav() {
  return (
    <nav className="navigation">
      <Link to="/about/">
        <Button>About</Button>
      </Link>
    </nav>
  );
}

export default Nav;
